import {takeLatest, put} from "redux-saga/effects";
import axios from 'axios';

function* singInAsync(data) {
  yield console.log('hihi');
}

export function* watchSingIn() {
  yield takeLatest("CALL-API-SINGIN", singInAsync(data));
}
